(433, '508201749286', 'Caddy DVD', 1, 1, '9.00', '11.00', 32, '7', 'kun', '<p>Этот адаптер для жесткого диска Serial ATA позволяет добавить второй жесткий диск в системы ноутбука.</p>\r\n\r\n<p>С помощью второго жесткого диска вы можете быстро хранить и создавать резервные копии важных данных. Добавьте этот caddy к ноутбуку, чтобы дать вам другой жесткий диск.</p>\r\n\r\n<p>Просто удалите ваш CD/DVD-ROM привод и поместите Caddy (с дополнительным жестким диском) на его место...</p>\r\n\r\n<p>Это хороший рабочий адаптер и гарантировано.</p>\r\n\r\n<p>100% новый товар высокого качества.</p>\r\n\r\n<p>Plug &amp; Play, поддерживает горячую замену</p>\r\n\r\n<p>Работает в ультрабуке 12,7 мм вашего компьютера.</p>\r\n\r\n<p>Принимает жесткие диски SATA HDD и SDD.</p>\r\n\r\n<p>Быстрое и надежное подключение к вашему устройству, как основной HDD</p>\r\n\r\n<p>Полностью интегрирован в ваш ноутбук, не требуется никаких кабелей/БП/драйвера программного обеспечения.</p>\r\n\r\n<p>Параметры:</p>\r\n\r\n<p>Материал: магналий</p>\r\n\r\n<p>Размер: 127x126x12,7 мм</p>\r\n\r\n<p>Интерфейс: SATA</p>\r\n\r\n<p>Применимость: работает в ультрабуках 12,7 мм вашего компьютера, таких как ThinkPad E420 E425 E430 L410, lenovo Y430 Y450 V450 E46 E46A, Dell N4010 N4030, acer Aspire 3750 3935, samsung E3415 RC410 и др.</p>\r\n', 'orico-sata-hdd-ssd-caddy-for-laptop-and-notebook-c'),
